import React, { Component } from 'react';
import Link from 'next/link'
class Index extends Component {
    state = {}
    render() {
        return (
            <>
                <Link href='/login'>Login</Link>
                <Link href='/login'>Signup</Link>
            </>
        );
    }
}

export default Index;
